    t,s,L,T = [],[],[],[]
    for line in lines:
        arr = line.split()
        t.append(float(arr[0]))
        s.append(float(arr[1]))
        L.append(float(arr[4]))
        T.append(float(arr[6]))
    return t,s,L,T
    
